import React, { Component } from 'react';
import Header from '../../components/header/Header';
import axios from 'axios';
import './style.css';

class CadastrotrodeEmpresas extends React.Component {

    state = {
        name: '',
        address: '',
        body: '',
        website: '',
        posts: []
    };

    getPost = () => {
        axios.get('/api')
        .then((response)=>{
          const data = response.data;
          this.setState({posts: data})
          console.log("Data has been received");
        })
        .catch(()=> {
          alert("error retriving data");
        });
    
      }

    render() {
        return (
            <div>
                <Header></Header>

                <div className="form-section">
                    <h1>Registre a sua empresa</h1>

                    <form onSubmit={2}>
                        <div className="form-input">
                            <input
                            type="text"
                            name="name"
                            value=""
                            placeholder="nome da empresa">
                            </input>
                        </div>

                        <div className="form-input">
                            <input
                            type="text"
                            name="address"
                            value=""
                            placeholder="endereço">
                            </input>
                        </div>

                        <div className="form-input">
                            <input
                            type="text"
                            name="body"
                            value=""
                            placeholder="Descreva os serviços que a sua empresa oferece">
                            </input>
                        </div>

                        <div className="form-input">
                            <input
                            type="text"
                            name="website"
                            value=""
                            placeholder="Digite o website da empresa">
                            </input>
                        </div>
                    </form>
                </div>
            </div>
        );
    }
}

export default CadastrotrodeEmpresas;
